  const [R6LogoSize, setR6LogoSize] = useState('large')

  return (
    <div className="NavBar">
      <div className="AppTitle">
        <img id="r6s-logo" alt="Rainbow Six: Siege" src={`images/ui/siege-logo-${R6LogoSize}.png`}/>
        <h1>Info Suite</h1>
      </div>
      <NavMenuButton />
    </div>
  )
}
